import React from 'react'
import styled from "styled-components";

const Cont = styled.div`
`

const TitleInfo = styled.h1`
font-size: 20px;
font-weight: bold;
`

const Title = () => {
  return (
   <Cont>
     <TitleInfo>Total Kasus Covid19 di Indonesia</TitleInfo>
   </Cont>
  )
}

export default Title
